import React from 'react';
import useBallMovement from '../../hooks/useBallMovement';
import './Ball.css';

const Ball = ({ ball }) => {
  const position = useBallMovement(ball.x, ball.y);

  return (
    <div
      className="ball"
      style={{
        left: position.x,
        top: position.y,
      }}
    ></div>
  );
};

export default Ball;
